<html lang="en">

<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">

  <title>Carousel Template for Bootstrap</title>

  <!-- Bootstrap core CSS -->
  <!-- <link href="../../build/css/stylesheet.css" rel="stylesheet" inline> -->
  <link href="../assets/css/bootstrap.css" rel="stylesheet" inline>
  <link href="../assets/css/style.css" rel="stylesheet" inline>
</head>

<body>
  <main role="main">
    <div class="closeBtn">
      <!-- TODO: add the inline tag -->
      <a href="#"><img src="../assets/images/close_btn.png"  /></a>
    </div>
    <div class="prev">
      <a href="../index.html"><img src="../assets/images/prev.png" inline></a>
    </div>
    <div class="next">
      <a href="../Page_02/page02.html"> <img src="../assets/images/next.png" inline></a>
    </div>
    <div class="homeBtn">
      <a href="../index.html"> <img src="../assets/images/home_btn.png" inline></a>
    </div>
    <div class="resetBtn">
      <a href="javascript:void(0)" onClick="window.location.reload()"> <img src="../assets/images/reset-btn.png" inline></a>
    </div>

    <!-- content for page -->
    <form>
      <div class="container">
        <div class="row">
          <div class="col-sm-12 heading animated fadeIn">
            <div class="thumb animated fadeIn delay-1s"><img src="../assets/images/top-heading.png" inline></div>
            <h1 class="animated slideInRight delay-2s">Practice Time</h1>
          </div>
        </div>

        <div class="row">
          <div class="col-sm-12 read-aloud animated slideInLeft delay-4s">Identify the pictures and write the missing
            letters.</div>
        </div>

        <div class="content-box">
          <div id="carouselExampleControls" class="carousel slide carousel-fade" data-ride="carousel" data-interval="false">
            <div class="carousel-inner">
              <div class="carousel-item active">
                <div class="row">
                  <div class="col-sm-12">
                    <div class="sound-text-box">
                      <div class="sound-box animated fadeIn delay-4s">
                        <div class="thumbmail"><img src="../assets/images/img1.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="bed" value="" onkeyup="bed()" maxlength="1"
                            name="">ed</div>
                      </div>
                      <div class="sound-box  animated fadeIn delay-5s">
                        <div class="thumbmail"><img src="../assets/images/img2.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="jet" value="" onkeyup="jet()" maxlength="1"
                            name="">et</div>
                      </div>
                      <div class="sound-box  animated fadeIn delay-6s">
                        <div class="thumbmail"><img src="../assets/images/img3.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="pet" value="" onkeyup="pet()" maxlength="1"
                            name="">et</div>
                      </div>
                      <div class="sound-box  animated fadeIn delay-7s">
                        <div class="thumbmail"><img src="../assets/images/img4.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="den" value="" onkeyup="den()" maxlength="1"
                            name="">en</div>
                      </div>
                    </div>
                  </div>
                </div>

                <a class="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
                  <span class="carousel-control-next-icon" aria-hidden="true">Next</span>
                  <span class="sr-only">Next</span>
                </a>
              </div>
              <div class="carousel-item">
                <div class="row">
                  <div class="col-sm-12">
                    <div class="sound-text-box">
                      <div class="sound-box  animated fadeIn delay-8s">
                        <div class="thumbmail"><img src="../assets/images/img5.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="gem" value="" onkeyup="gem()" maxlength="1"
                            name="">em</div>
                      </div>

                      <div class="sound-box  animated fadeIn delay-9s">
                        <div class="thumbmail"><img src="../assets/images/img6.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="net" value="" onkeyup="net()" maxlength="1"
                            name="">et</div>
                      </div>

                      <div class="sound-box  animated fadeIn delay-10s">
                        <div class="thumbmail"><img src="../assets/images/img7.png" inline /></div>
                        <div class="thumbmail-details"><input type="text" id="pen" value="" onkeyup="pen()" maxlength="1"
                            name="">en</div>
                      </div>
                      <div class="sound-box padidng-bottom animated fadeIn delay-11s">
                        <div class="thumbmail "><img src="../assets/images/help-img.png" inline /></div>

                      </div>

                    </div>

                  </div>
                </div>

                <a class="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
                  <span class="carousel-control-prev-icon" aria-hidden="true">Previous</span>
                  <span class="sr-only">Previous</span>
                </a>
              </div>

            </div>






          </div>



        </div>
      </div>

      </div>
    </form>
  </main>
